.text	

.macro xy_coords
       la $s0, PLAYER_LOC
       lw $s1, 0($s0)
       lw $s2, 4($s0)
.end_macro

.macro char_address(%x, %y)
       la $t6, BASE_ADDRESS   #t6 = address of framebuffer
       sll $t8, %x, 2        #t8 = 4x
       sll $t9, %y, 8        #t9 = 4*64y
       add $t7, $t8, $t9      #t7 = offset from framebuffer
       add $t7, $t7, $t6      #t7 = player address
.end_macro       

.macro debug1
       li $v0, 4             #load command
       la $a0, str1          #save str1 for syscall
       syscall               #print str1
.end_macro

.macro debug2 (%reg)
       li $v0, 1
       add $a0, %reg, $zero
       syscall               #print do_addition return
       li $v0, 4             #load command
       la $a0, str2          #save str1 for syscall
       syscall               #print str1
.end_macro

.macro push (%reg)
       addi $sp, $sp, -4
       sw %reg, 0($sp)
.end_macro

.macro pop (%reg)
       lw %reg, 0($sp)
       addi $sp, $sp, 4
.end_macro

.globl main

main:
reset_game:
       jal clear_screen
       li $a0, 0
       jal hp_change
       jal hp_change
       jal hp_change
begin: jal draw_stage
       jal add_hell
       li $a0, 1
       jal draw_player
       la $t0, hp
       lw $t0, 0($t0)
       beq $t0, 0, GAME_OVER  #change to game over
loop:  
       li $a0, 0
       jal draw_player
       jal update_player  
       jal collision_check  
       li $a0, 1
       jal draw_player
       li $v0, 32
       li $a0, 50
       syscall
       j loop
GAME_OVER: 
       jal clear_screen  ###change to game over
       li $t0 23
       li $t1, 23
       char_address ($t0, $t1)
       li $t0, WHITE
       sw $t0, 4($t7) #row 1
