GAME_OVER_LOOP:       
       beq $t0, 113, END
       li $t0, 0xffff0000
       lw $t1, 0($t0)
       bne $t1, 1, GAME_OVER_LOOP
       lw $t0, 4($t0)
       beq $t0, 112, RESTART
       j GAME_OVER_LOOP
END:
       jal clear_screen
       li $v0, 10
       syscall
       
clear_screen:
       li $t1, SCREEN_WIDTH
       mul $t1, $t1, SCREEN_HEIGHT
	sll $t1, $t1, 2
	li $t0, BASE_ADDRESS	# load start address into $t0
	addi $t1, $t1, BASE_ADDRESS	# load final address into $t1
clear_screen_loop:
	sw $zero, 0($t0)		# clear pixel
	addi $t0, $t0, 4
	ble $t0, $t1, clear_screen_loop
	jr $ra
update_player:
       li $t0, 0xffff0000
       lw $t1, 0($t0)
       
       la $t3, VERTICAL
       lw $t4, 0($t3)
       add $s2, $s2, $t4
       beq $t4, GRAVITY,  cont
       addi $t4, $t4, GRAVITY
       sw $t4, 0($t3)

cont:  push ($ra)
       jal update_char_array
       pop ($ra)
       
       bne $t1, 1, end_player_update
       lw $t0, 4($t0)
       
       beq $t0, 119, UP
       beq $t0, 97, LEFT
       beq $t0, 100, RIGHT
       beq $t0, 112, RESTART
       beq $t0, 113, GAME_OVER
#       beq $t0, 115, DOWN
       jr $ra
UP:    
       li $a1, 1
       char_address($s1, $s2)
       move $a0, $t7
       push ($ra)
       jal platform_check
       pop ($ra)
       beq $v0, 1, update_char_array
       la $t3, VERTICAL
       li $t4, -5
       sw $t4, 0($t3)
       j update_char_array
LEFT:    
       addi $s1, $s1, -SIDEMOVE
       addi $s2, $s2, -GRAVITY
       j update_char_array     
RIGHT:    
       addi $s1, $s1, SIDEMOVE
       addi $s2, $s2, -GRAVITY
       j update_char_array 
#DOWN:    
#       addi $s2, $s2, 1
update_char_array:
       blt $s1, 0, end_player_update
       bgt $s1, 63, end_player_update
      
       blt $s2, 2, end_player_update
       bgt $s2, 63, end_player_update

       char_address($s1, $s2)
       move $a0, $t7
       push($ra)
       li $a1, 0
       jal platform_check
       pop($ra)
       beq $v0, 0, end_player_update
      
       sw $s1, 0($s0)
       sw $s2, 4($s0)
end_player_update:
       jr $ra
       
draw_player:
       xy_coords
       char_address($s1, $s2)
       beq $a0, 0, clear_player
       beq $a0, 2, hit_object
       beq $a0, 4, create_burned_big
       beq $a0, 5, create_burned_small
       li $t4, BEIGE
       li $t5, BLUE
       li $t6, WHITE
       j create_player
clear_player:
       li $t4, 0
       li $t5, 0
       li $t6, 0
       j create_player
hit_object:
       li $t4, RED
       li $t5, BLUE
       li $t6, WHITE
create_player:
       sw $t6, 0($t7)
       sw $t6, 4($t7)
       sw $t5, -256($t7)
       sw $t5, -252($t7)
       sw $t4, -512($t7)
       sw $t4, -508($t7)
       jr $ra
create_burned_big:
       li $t4, RED
       li $t5, YELLOW
       li $t6, ORANGE
       beq $s1, 0, left_edge
       sw $t4, -4($t7)
       sw $t4, -260($t7)
left_edge:  
       beq $s1, 64, right_edge
       sw $t4, 8($t7)
       sw $t4, -248($t7)
right_edge:    
       sw $t5, 0($t7)
       sw $t5, 4($t7)
       sw $t5, -256($t7)
       sw $t6, -252($t7)
       sw $t6, -512($t7)
       sw $t4, -508($t7)
       sw $t4, -768($t7)
       jr $ra
create_burned_small:
       li $t4, RED
       li $t5, YELLOW
       li $t6, ORANGE
       sw $zero, -4($t7)
       sw $t5, 0($t7)
       sw $t5, 4($t7)
       sw $zero, 8($t7)
       sw $zero, -260($t7)
       sw $t4, -256($t7)
       sw $t6, -252($t7)
       sw $zero, -248($t7)
       sw $zero, -512($t7)
       sw $t4, -508($t7)
       sw $zero, -768($t7)
       jr $ra
       
draw_stage:
	li $t1, SCREEN_WIDTH
	mul $t1, $t1, 51
	sll $t1, $t1, 2
