       li $t6, PLTFRM_CLR
       beq $a1, 1, base
       lw $t8, -256($a0)
       beq $t8, $t6, touching_platform
       lw $t8, -252($a0)
       beq $t8, $t6, touching_platform
       lw $t8, -512($a0)
       beq $t8, $t6, touching_platform
       lw $t8, -508($a0)
       beq $t8, $t6, touching_platform
