       xy_coords
       li $s1, 0
       li $s2, 2
       sw $s1, 0($s0)
       sw $s2, 4($s0)
       la $t0, hp
       li $t1, 0
       sw $t1, 0($t0)
       j reset_game
       
 collision_check:
        xy_coords
        char_address ($s1, $s2)
        li $t8, RED
        li $t6, SILVER
        lw $t9, 0($t7)
        beq $t8, $t9, hit_fire
        beq $t6, $t9, hit_spike
        lw $t9, 4($t7)
        beq $t8, $t9, hit_fire
        beq $t6, $t9, hit_spike
        jr $ra
 hit_fire:  
        li $a0, 2
        jal draw_player
        li $v0, 32
        li $a0, 400
        syscall
        li $a0, 4
        jal draw_player
        li $a0, 200
        syscall
        li $a0, 5
        jal draw_player
        li $a0, 200
        syscall
        li $a0 0
        jal draw_player
        li $a0, 1
        jal hp_change
        j REGENERATE
hit_spike:
        li $a0, 2
        jal draw_player
        li $v0, 32
        li $a0, 600
        syscall
        sw $zero, -512($t7)
        sw $zero, -508($t7)
        li $a0, 200
        syscall
        sw $zero, -256($t7)
        sw $zero, -252($t7)
        syscall
        sw $zero, 0($t7)
        sw $zero, 4($t7)
        syscall
        
        li $a0, 1
        jal hp_change
        j REGENERATE
        
       
       
REGENERATE:
       xy_coords
       li $s1, 0
       li $s2, 2
       sw $s1, 0($s0)
       sw $s2, 4($s0)
       j begin
hp_change:
       la $t1, hp
       lw $t2, 0($t1)
       li $t3, 3
       li $t4, 63
       char_address ($t3, $t4)
       beq $a0, 1, lose_hp
       mul $t3, $t2, 24
       add $t7, $t3, $t7
       addi $t2, $t2, 1
       sw $t2, 0($t1)
       li $t0, RED
       j apply_hp_change
lose_hp:
       addi $t2, $t2, -1
       sw $t2, 0($t1)
       mul $t3, $t2, 24
       add $t7, $t3, $t7
       li $t0, 0
apply_hp_change:
       sw $t0, 0($t7) #row 1
       sw $t0, -260($t7) #row 2
       sw $t0, -256($t7) 
       sw $t0, -252($t7)
       sw $t0, -520($t7) #row 3
       sw $t0, -516($t7)
       sw $t0, -512($t7)
       sw $t0, -508($t7)
       sw $t0, -504($t7)
       sw $t0, -776($t7) #row 4
       sw $t0, -772($t7)
       sw $t0, -764($t7)
       sw $t0, -760($t7)
       jr $ra
